import {
	get,
	post
} from './http'


//系统参数列表
export const getSysParam = p => get('api/sysParams', p)

export const getOperator = p => get('api/operators', p)

export const getOperateLog = p => get('api/operateLogs', p)

export const getSysCode = p => get('api/sysCodes', p)
